import React from 'react';

const Speakers = () => {
  return (
    <div>
      <img src='images/speaker-component-1.png' />
      <img src='images/speaker-component-2.png' />
      <img src='images/speaker-component-3.png' />
    </div>
  );
}

export default Speakers;
